import React from 'react';

const GoalList = props => {
    console.log(props.goals);
    return(
        <ul className='weekgoal'>{
            props.goals.map(goal =>{
                return <li>{goal.text}</li>
            })

        }</ul>
    );
    
};

export default GoalList;
